import './App.css';
import NavigationBar from './components/NavigationBar';
import Header from './components/Header';
import RekomendasiProduk from './components/RekomendasiProduk';
import CardKategori from './components/CardKategori';
import CTAMotor from './components/CTAMotor';
import './style/custom.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Login from 'lo' 


function App() {
  return (
    <div>
      <NavigationBar />
      <Header />
      <RekomendasiProduk />
      <CardKategori />
      <CTAMotor />
      <BrowserRouter>
        <Switch>
          <Route path='/login' exact component="{}"></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
